import unittest

from bonus import bonus
from q1 import q1
from q2 import q2
from q3 import q3
from q4 import q4
from q5 import q5


class BaseTestCase(unittest.TestCase):
    def test_q1(self):
        self.assertEqual(2, q1([180, 166, 170, 180]))
        self.assertEqual(1, q1([180, 166, 170]))
        self.assertEqual(3, q1([180, 166, 170, 180, 180]))
        self.assertEqual(3, q1([1, 22, 2, 333, 55, 3, 2, 333, 21, 3, 2, 333]))
        self.assertEqual(4, q1([10, 10, 10, 2, 5, 4, 2, 10]))

    def test_q2(self):
        self.assertEqual([1, 4, 9], q2(1, 9))
        self.assertEqual([1, 4, 9], q2(1, 15))
        self.assertEqual([1, 4, 9, 16], q2(1, 16))
        self.assertEqual([], q2(20, 20))
        self.assertEqual([1], q2(1, 1))
        self.assertEqual([36, 49, 64, 81], q2(30, 90))
        self.assertEqual([1, 4, 9, 16, 25, 36, 49, 64, 81, 100], q2(1, 100))

    def test_q3(self):
        self.assertEqual(3, q3([1, 2, 4, 5, 7, 8, 10], 3))
        self.assertEqual(3, q3([1, 1, 2, 3, 4], 1))
        self.assertEqual(0, q3([1, 1, 2, 3, 4], 2))
        self.assertEqual(2, q3([1, 5, 9, 10, 12, 14, 18, 20, 23, 24, 30], 4))
        self.assertEqual(0, q3([1, 5, 9, 10, 12, 14, 18, 20, 23, 24, 30], 5))
        self.assertEqual(2, q3([1, 5, 9, 10, 12, 14, 17, 20, 23, 24, 30], 3))
        self.assertEqual(1, q3([1, 6, 11, 12, 14, 17, 20, 23, 24, 30], 5))

    def test_q4(self):
        self.assertEqual(4, q4('hexaVemEsseAno'))
        self.assertEqual(5, q4('testEsseCasoTesteExemplo'))
        self.assertEqual(0, q4(''))
        self.assertEqual(1, q4('a'))
        self.assertEqual(1, q4('aa'))
        self.assertEqual(2, q4('aB'))
        self.assertEqual(7, q4('vouTestarEssaFuncaoDessaManeiraDiferenciada'))

    def test_q5(self):
        self.assertEqual(True, q5('abc'))
        self.assertEqual(True, q5('abcc'))
        self.assertEqual(False, q5('abccc'))
        self.assertEqual(True, q5('abbccca'))
        self.assertEqual(False, q5('abbcccaa'))
        self.assertEqual(True, q5('abbbcccaaa'))
        self.assertEqual(True, q5('abcdefigjklrmcn'))
        self.assertEqual(True, q5('abababababababijijijijijijij'))
        self.assertEqual(True, q5('abababababababijijijijijijijc'))
        self.assertEqual(False, q5('abababababababijijijijijijijcc'))
        self.assertEqual(True, q5('aaaaaaaaa'))

